def polymers(string):
    lengths = [];
    for b in range(65, 90):
        flag = True;
        newString = string;
        startPoint = 0;
        charConverted = chr(b);
        charConverted2 = chr(b + 32)
        while(flag):
            flag = False;
            for c in range(startPoint, len(newString)):
                if (newString[c] == charConverted or newString[c] == charConverted2):
                    startPoint -= 1;
                    newString = (newString[:c] + newString[c+1:]);
                    flag = True;
                    break;
                startPoint += 1;
        start = 0;
        check = True;
        while(check):
            check = False;
            for a in range(start, len(newString) - 1):
                uniCode = ord(newString[a]);
                uniCodeOfNext = ord(newString[a+1]);
                if(abs(uniCode - uniCodeOfNext) == 32):
                    check = True;
                    if (a+2 > len(newString)):
                        newString = (newString[:a]);
                        if (a > 0):
                            start -= 1;
                    else:
                        newString = (newString[:a] + newString[a+2:]);
                        if (a > 0):
                            start -= 1;
                    break;
                start += 1;
        print(len(newString));
        lengths.append(len(newString));
    return lengths;
    






